import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';
import MiniBoard from './MiniBoard';

export default class Home extends Component {

  MiniSudoku() {
      return (
        <div>Lucas</div>
      )
  }

  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col>
              <MiniBoard />
            </Col>
          </Row>
        </Container>
      </div>
    )
  }
}
